int findChampion(int** grid, int gridSize, int* gridColSize) {
    // Iterate over each team
    for (int i = 0; i < gridSize; i++) {
        int isChampion = 1; // Assume team i is the champion initially

        // Check if any other team is stronger than team i
        for (int j = 0; j < gridSize; j++) {
            if (i != j && grid[j][i] == 1) {
                // If any team j is stronger than team i, then team i cannot be the champion
                isChampion = 0;
                break;
            }
        }

        // If no team is stronger than team i, then team i is the champion
        if (isChampion) {
            return i;
        }
    }

    // This line should never be reached, as per the problem constraints
    return -1;
}
